ock('react-router-dom');\nconst { MemoryRouter } = jest.requireActual('react-router-dom');\n\ndescribe(\"utils/currentUser tests\", () => {\n    describe(\"useCurrentUser tests\", () => {\n        test(\"useCurrentUser retrieves initial data\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").timeoutOnce();\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n            await waitFor(() => result.current.isSuccess);\n\n            expect(result.current.data).toEqual({ loggedIn: false, root: null, initialData:true });\n            \n            const queryState = queryClient.getQueryState(\"current user\");\n            expect(queryState).toBeDefined();\n\n            queryClient.clear();\n\n            await waitFor( ()=> expect(console.error).toHaveBeenCalled() );\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n        });\n\n        test(\"useCurrentUser retrieves data from API\", async () => {\n\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n           \n\n            expect(result.current.data).toEqual(currentUserFixtures.userOnly);\n            queryClient.clear();\n\n        });\n\n        test(\"useCurrentUser when API unreachable\", async () => {\n\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(404)\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n\n            expect(result.current.data).toEqual({ loggedIn: false, root: null });\n            queryClient.clear();\n        });\n\n        test(\"useCurrentUser handles missing roles correctly\", async () => {\n\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const apiResult = apiCurrentUserFixtures.missingRolesToTestErrorHandling;\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiResult);\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useCurrentUser(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error getting roles: /);\n            restoreConsole();\n\n            let expectedResult = { loggedIn: true, root: { ...apiResult, rolesList: [\"ERROR_GETTING_ROLES\"] } };\n            expect(result.current.data).toEqual(expectedResult);\n            queryClient.clear();\n        });\n\n    });\n    describe(\"useLogout tests\", () => {\n        test(\"useLogout\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        {children}\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onPost(\"/logout\").reply(200);\n\n            const navigateSpy = jest.fn();\n            useNavigate.mockImplementation(() => navigateSpy);\n\n            const resetQueriesSpy = jest.spyOn(queryClient, 'resetQueries');\n            \n            const { result, waitFor } = renderHook(() => useLogout(), { wrapper });\n\n            act(() => {\n                expect(useNavigate).toHaveBeenCalled();\n                result.current.mutate();\n            });\n            await waitFor(() => expect(navigateSpy).toHaveBeenCalledWith(\"/\"));\n\n            await waitFor(() => expect(resetQueriesSpy).toHaveBeenCalledWith(\"current user\", { exact: true }));\n\n            queryClient.clear();\n        });\n    });\n    describe(\"hasRole tests\", () => {\n        test('hasRole(x,\"ROLE_ADMIN\") return falsy when currentUser ill-defined', async () => {\n            expect(hasRole(null, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({}, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: null }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: null }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: {} }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: null } }, \"ROLE_ADMIN\")).toBeFalsy();\n        });\n\n        test('hasRole(x,\"ROLE_ADMIN\") returns correct values when currentUser properly defined', async () => {\n            expect(hasRole({ loggedIn: true, root: { rolesList: [] } }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: [\"ROLE_USER\"] } }, \"ROLE_ADMIN\")).toBeFalsy();\n            expect(hasRole({ loggedIn: true, root: { rolesList: [\"ROLE_USER\", \"ROLE_ADMIN\"] } }, \"ROLE_ADMIN\")).toBeTruthy();\n        });\n\n    });\n});\n"},"src/tests/components/Nav/AppNavbar.test.js":{"tests":[{"id":"7","name":"AppNavbar tests renders correctly for regular logged in user","location":{"start":{"column":6,"line":13}}},{"id":"8","name":"AppNavbar tests renders correctly for admin user","location":{"start":{"column":6,"line":29}}},{"id":"9","name":"AppNavbar tests renders H2Console and Swagger links correctly","location":{"start":{"column":6,"line":47}}},{"id":"10","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://localhost:3000","location":{"start":{"column":6,"line":69}}},{"id":"11","name":"AppNavbar tests renders the AppNavbarLocalhost when on http://127.0.0.1:3000","location":{"start":{"column":6,"line":89}}},{"id":"12","name":"AppNavbar tests does NOT render the AppNavbarLocalhost when on localhost:8080","location":{"start":{"column":6,"line":109}}},{"id":"13","name":"AppNavbar tests renders the ucsbdates link correctly","location":{"start":{"column":6,"line":131}}},{"id":"14","name":"AppNavbar tests renders the restaurants link correctly","location":{"start":{"column":6,"line":152}}},{"id":"15","name":"AppNavbar tests Restaurant and UCSBDates links do NOT show when not logged in","location":{"start":{"column":6,"line":173}}},{"id":"16","name":"AppNavbar tests when oauthlogin undefined, default value is used","location":{"start":{"column":6,"line":190}}}],"source":"import { render, screen} from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\nimport AppNavbar from \"main/components/Nav/AppNavbar\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"AppNavbar tests\", () => {\n\n    const queryClient = new QueryClient();\n\n    test(\"renders correctly for regular logged in user\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Welcome, pconrad.cis@gmail.com\");\n    });\n\n    test(\"renders correctly for admin user\", async () => {\n\n        const currentUser = currentUserFixtures.adminUser;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Welcome, phtcon@ucsb.edu\");\n        const adminMenu = screen.getByTestId(\"appnavbar-admin-dropdown\");\n        expect(adminMenu).toBeInTheDocument();        \n    });\n\n    test(\"renders H2Console and Swagger links correctly\", async () => {\n\n        const currentUser = currentUserFixtures.adminUser;\n        const systemInfo = systemInfoFixtures.showingBoth;\n\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"H2Console\");\n        const swaggerMenu = screen.getByText(\"Swagger\");\n        expect(swaggerMenu).toBeInTheDocument();        \n    });\n\n\n\n    test(\"renders the AppNavbarLocalhost when on http://localhost:3000\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingBoth;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://localhost:3000')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByTestId(\"AppNavbarLocalhost\");\n    });\n\n    test(\"renders the AppNavbarLocalhost when on http://127.0.0.1:3000\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingBoth;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://127.0.0.1:3000')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByTestId(\"AppNavbarLocalhost\");\n    });\n\n    test(\"does NOT render the AppNavbarLocalhost when on localhost:8080\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingBoth;\n        const doLogin = jest.fn();\n\n        delete window.location\n        window.location = new URL('http://localhost:8080')\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByTestId(\"AppNavbar\");\n        expect(screen.queryByTestId(/AppNavbarLocalhost/i)).toBeNull();\n    });\n\n\n    test(\"renders the ucsbdates link correctly\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingBoth;\n\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"UCSB Dates\");\n        const link = screen.getByText(\"UCSB Dates\");\n        expect(link).toBeInTheDocument();\n        expect(link.getAttribute(\"href\")).toBe(\"/ucsbdates\");\n    });\n\n    test(\"renders the restaurants link correctly\", async () => {\n\n        const currentUser = currentUserFixtures.userOnly;\n        const systemInfo = systemInfoFixtures.showingBoth;\n\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Restaurants\");\n        const link = screen.getByText(\"Restaurants\");\n        expect(link).toBeInTheDocument();\n        expect(link.getAttribute(\"href\")).toBe(\"/restaurants\");\n    });\n\n    test(\"Restaurant and UCSBDates links do NOT show when not logged in\", async () => {\n        const currentUser = null;\n        const systemInfo = systemInfoFixtures.showingBoth;\n        const doLogin = jest.fn();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} doLogin={doLogin} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(screen.queryByText(\"Restaurants\")).not.toBeInTheDocument();\n        expect(screen.queryByText(\"UCSBDates\")).not.toBeInTheDocument();\n    });\n\n    test(\"when oauthlogin undefined, default value is used\", async () =>  {\n        const currentUser = currentUserFixtures.notLoggedIn;\n        const systemInfo = systemInfoFixtures.oauthLoginUndefined;\n\n       render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AppNavbar currentUser={currentUser} systemInfo={systemInfo} />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Log In\");\n        expect(screen.getByText(\"Log In\")).toHaveAttribute(\"href\", \"/oauth2/authorization/google\");\n    });\n\n});\n\n\n"},"src/tests/utils/useBackend.test.js":{"tests":[{"id":"17","name":"utils/useBackend tests utils/useBackend useBackend tests useBackend handles 404 error correctly","location":{"start":{"column":10,"line":35}}},{"id":"18","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles success correctly","location":{"start":{"column":10,"line":72}}},{"id":"19","name":"utils/useBackend tests utils/useBackend useBackendMutation tests useBackendMutation handles error correctly","location":{"start":{"column":10,"line":127}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { renderHook, act } from '@testing-library/react-hooks'\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { useBackend, useBackendMutation } from \"main/utils/useBackend\";\n\n\njest.mock('react-router-dom');\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\n\ndescribe(\"utils/useBackend tests\", () => {\n\n    beforeEach(() => {\n        jest.spyOn(console, 'error')\n        console.error.mockImplementation(() => null);\n    });\n\n    afterEach(() => {\n        console.error.mockRestore()\n    });\n \n    describe(\"utils/useBackend useBackend tests\", () => {\n\n        test(\"useBackend handles 404 error correctly\", async () => {\n\n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        // ✅ turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n\n            axiosMock.onGet(\"/api/admin/users\").reply(404, {});\n\n            const { result, waitFor } = renderHook(() => useBackend(\n                [\"/api/admin/users\"],\n                { method: \"GET\", url: \"/api/admin/users\" },\n                [\"initialData\"]\n            ), { wrapper });\n\n            await waitFor(() => result.current.isError);\n\n            expect(result.current.data).toEqual([\"initialData\"]);\n            await waitFor(() => expect(console.error).toHaveBeenCalled());\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(\"Error communicating with backend via GET on /api/admin/users\");\n\n        });\n    });\n    describe(\"utils/useBackend useBackendMutation tests\", () => {\n        test(\"useBackendMutation handles success correctly\", async () => {\n\n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        // ✅ turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            var axiosMock = new AxiosMockAdapter(axios);\n\n            axiosMock.onPost(\"/api/ucsbdates/post\").reply(202, {\n                id: 17,\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n\n            });\n\n            const objectToAxiosParams = (ucsbDate) => ({\n                url: \"/api/ucsbdates/post\",\n                method: \"POST\",\n                params: {\n                    quarterYYYYQ: ucsbDate.quarterYYYYQ,\n                    name: ucsbDate.name,\n                    localDateTime: ucsbDate.localDateTime\n                }\n            });\n\n            const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n                mockToast(`New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`);\n            });\n\n            const { result, waitFor } = renderHook(\n                () => useBackendMutation(objectToAxiosParams, { onSuccess }, [\"/api/ucsbdates/all\"]), { wrapper }\n            );\n\n            const mutation = result.current;\n            act(() => mutation.mutate({\n                quarterYYYYQ: '20221',\n                name: 'Groundhog Day',\n                localDateTime: '2022-02-02T12:00'\n            }));\n\n            await waitFor(() => expect(onSuccess).toHaveBeenCalled());\n            expect(mockToast).toHaveBeenCalledWith(\"New ucsbDate Created - id: 17 name: Groundhog Day\");\n        });\n        test(\"useBackendMutation handles error correctly\", async () => {\n\n\n            // See: https://react-query.tanstack.com/guides/testing#turn-off-retries\n            const queryClient = new QueryClient({\n                defaultOptions: {\n                    queries: {\n                        // ✅ turns retries off\n                        retry: false,\n                    },\n                },\n            })\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock = new AxiosMockAdapter(axios);\n            axiosMock.onPost(\"/api/ucsbdates/post\").reply(404);\n\n            const objectToAxiosParams = (ucsbDate) => ({\n                url: \"/api/ucsbdates/post\",\n                method: \"POST\",\n                params: {\n                    quarterYYYYQ: ucsbDate.quarterYYYYQ,\n                    name: ucsbDate.name,\n                    localDateTime: ucsbDate.localDateTime\n                }\n            });\n\n            const onSuccess = jest.fn().mockImplementation((ucsbDate) => {\n                mockToast(`New ucsbDate Created - id: ${ucsbDate.id} name: ${ucsbDate.name}`);\n            });\n\n            const { result, waitFor } = renderHook(\n                () => useBackendMutation(objectToAxiosParams, { onSuccess }), { wrapper }\n            );\n\n            const mutation = result.current;\n\n            mutation.mutate({\n                quarterYYYYQ: '20221',\n                name: 'Bastille Day',\n                localDateTime: '2022-06-14T12:00'\n            }, {\n                onError: (e) => console.error(\"onError from mutation.mutate called!\", String(e).substring(0, 199))\n            });\n\n            await waitFor(() => expect(mockToast).toHaveBeenCalled());\n            expect(mockToast).toHaveBeenCalledTimes(2);\n            expect(mockToast).toHaveBeenCalledWith(\"Axios Error: Error: Request failed with status code 404\");\n            expect(mockToast).toHaveBeenCalledWith(\"Error: Request failed with status code 404\");\n\n            expect(console.error).toHaveBeenCalledTimes(3);\n            const errorMessage0 = console.error.mock.calls[0][0];\n            expect(errorMessage0).toMatch(/Axios Error:/);\n            const errorMessage1 = console.error.mock.calls[1][0];\n            expect(errorMessage1.message).toMatch(/Request failed with status code 404/);\n            const errorMessage2 = console.error.mock.calls[2][0];\n            expect(errorMessage2).toMatch(/onError from mutation.mutate called!/);\n        });\n    });\n});"},"src/tests/pages/UCSBDates/UCSBDatesEditPage.test.js":{"tests":[{"id":"20","name":"UCSBDatesEditPage tests when the backend doesn't return data renders header but table is not present","location":{"start":{"column":10,"line":51}}},{"id":"21","name":"UCSBDatesEditPage tests tests where backend is w
