ply(200, systemInfoFixtures.showingNeither);\n            axiosMock.onGet(\"/api/ucsbdates\", { params: { id: 17 } }).timeout();\n        });\n\n        const queryClient = new QueryClient();\n        test(\"renders header but table is not present\", async () => {\n\n            const restoreConsole = mockConsole();\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"UCSBDatesEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n            await screen.findByText(\"Edit UCSBDate\");\n            expect(screen.queryByTestId(\"UCSBDateForm-quarterYYYYQ\")).not.toBeInTheDocument();\n            restoreConsole();\n        });\n    });\n\n    describe(\"tests where backend is working normally\", () => {\n\n        const axiosMock = new AxiosMockAdapter(axios);\n\n        beforeEach(() => {\n            axiosMock.reset();\n            axiosMock.resetHistory();\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n            axiosMock.onGet(\"/api/ucsbdates\", { params: { id: 17 } }).reply(200, {\n                id: 17,\n                quarterYYYYQ: '20221',\n                name: \"Pi Day\",\n                localDateTime: \"2022-03-14T15:00\"\n            });\n            axiosMock.onPut('/api/ucsbdates').reply(200, {\n                id: \"17\",\n                quarterYYYYQ: '20224',\n                name: \"Christmas Morning\",\n                localDateTime: \"2022-12-25T08:00\"\n            });\n        });\n\n        const queryClient = new QueryClient();\n        test(\"renders without crashing\", () => {\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"UCSBDatesEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n        });\n\n        test(\"Is populated with the data provided\", async () => {\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"UCSBDatesEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n\n            const idField = screen.getByTestId(\"UCSBDateForm-id\");\n            const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n            const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n            const localDateTimeField = screen.getByTestId(\"UCSBDateForm-localDateTime\");\n            const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n            expect(idField).toHaveValue(\"17\");\n            expect(quarterYYYYQField).toHaveValue(\"20221\");\n            expect(nameField).toHaveValue(\"Pi Day\");\n            expect(localDateTimeField).toHaveValue(\"2022-03-14T15:00\");\n            expect(submitButton).toBeInTheDocument();\n        });\n\n        test(\"Changes when you click Update\", async () => {\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"UCSBDatesEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n\n            const idField = screen.getByTestId(\"UCSBDateForm-id\");\n            const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n            const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n            const localDateTimeField = screen.getByTestId(\"UCSBDateForm-localDateTime\");\n            const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n            expect(idField).toHaveValue(\"17\");\n            expect(quarterYYYYQField).toHaveValue(\"20221\");\n            expect(nameField).toHaveValue(\"Pi Day\");\n            expect(localDateTimeField).toHaveValue(\"2022-03-14T15:00\");\n\n            expect(submitButton).toBeInTheDocument();\n\n            fireEvent.change(quarterYYYYQField, { target: { value: '20224' } })\n            fireEvent.change(nameField, { target: { value: 'Christmas Morning' } })\n            fireEvent.change(localDateTimeField, { target: { value: \"2022-12-25T08:00\" } })\n\n            fireEvent.click(submitButton);\n\n            await waitFor(() => expect(mockToast).toBeCalled());\n            expect(mockToast).toBeCalledWith(\"UCSBDate Updated - id: 17 name: Christmas Morning\");\n            expect(mockNavigate).toBeCalledWith({ \"to\": \"/ucsbdates\" });\n\n            expect(axiosMock.history.put.length).toBe(1); // times called\n            expect(axiosMock.history.put[0].params).toEqual({ id: 17 });\n            expect(axiosMock.history.put[0].data).toBe(JSON.stringify({\n                quarterYYYYQ: '20224',\n                name: \"Christmas Morning\",\n                localDateTime: \"2022-12-25T08:00\"\n            })); // posted object\n\n        });\n\n       \n    });\n});\n\n\n"},"src/tests/pages/Restaurants/RestaurantEditPage.test.js":{"tests":[{"id":"24","name":"RestaurantEditPage tests when the backend doesn't return data renders header but table is not present","location":{"start":{"column":10,"line":50}}},{"id":"25","name":"RestaurantEditPage tests tests where backend is working normally Is populated with the data provided","location":{"start":{"column":10,"line":90}}},{"id":"26","name":"RestaurantEditPage tests tests where backend is working normally Changes when you click Update","location":{"start":{"column":10,"line":135}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport RestaurantEditPage from \"main/pages/Restaurants/RestaurantEditPage\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\nconst mockNavigate = jest.fn();\njest.mock('react-router-dom', () => {\n    const originalModule = jest.requireActual('react-router-dom');\n    return {\n        __esModule: true,\n        ...originalModule,\n        useParams: () => ({\n            id: 17\n        }),\n        Navigate: (x) => { mockNavigate(x); return null; }\n    };\n});\n\ndescribe(\"RestaurantEditPage tests\", () => {\n\n    describe(\"when the backend doesn't return data\", () => {\n\n        const axiosMock = new AxiosMockAdapter(axios);\n\n        beforeEach(() => {\n            axiosMock.reset();\n            axiosMock.resetHistory();\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n            axiosMock.onGet(\"/api/restaurants\", { params: { id: 17 } }).timeout();\n        });\n\n        const queryClient = new QueryClient();\n        test(\"renders header but table is not present\", async () => {\n\n            const restoreConsole = mockConsole();\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"RestaurantEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n            await screen.findByText(\"Edit Restaurant\");\n            expect(screen.queryByTestId(\"Restaurant-name\")).not.toBeInTheDocument();\n            restoreConsole();\n        });\n    });\n\n    describe(\"tests where backend is working normally\", () => {\n\n        const axiosMock = new AxiosMockAdapter(axios);\n\n        beforeEach(() => {\n            axiosMock.reset();\n            axiosMock.resetHistory();\n            axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n            axiosMock.onGet(\"/api/restaurants\", { params: { id: 17 } }).reply(200, {\n                id: 17,\n                name: \"Freebirds\",\n                description: \"Burritos\"\n            });\n            axiosMock.onPut('/api/restaurants').reply(200, {\n                id: \"17\",\n                name: \"Freebirds World Burrito\",\n                description: \"Really big Burritos\"\n            });\n        });\n\n        const queryClient = new QueryClient();\n    \n        test(\"Is populated with the data provided\", async () => {\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"RestaurantEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            await screen.findByTestId(\"RestaurantForm-id\");\n\n            const idField = screen.getByTestId(\"RestaurantForm-id\");\n            const nameField = screen.getByTestId(\"RestaurantForm-name\");\n            const descriptionField = screen.getByTestId(\"RestaurantForm-description\");\n            const submitButton = screen.getByTestId(\"RestaurantForm-submit\");\n\n            expect(idField).toBeInTheDocument();\n            expect(idField).toHaveValue(\"17\");\n            expect( nameField).toBeInTheDocument();\n            expect(nameField).toHaveValue(\"Freebirds\");\n            expect(descriptionField).toBeInTheDocument();\n            expect(descriptionField).toHaveValue(\"Burritos\");\n\n            expect(submitButton).toHaveTextContent(\"Update\");\n\n            fireEvent.change(nameField, { target: { value: 'Freebirds World Burrito' } });\n            fireEvent.change(descriptionField, { target: { value: 'Totally Giant Burritos' } });\n            fireEvent.click(submitButton);\n\n            await waitFor(() => expect(mockToast).toBeCalled());\n            expect(mockToast).toBeCalledWith(\"Restaurant Updated - id: 17 name: Freebirds World Burrito\");\n            \n            expect(mockNavigate).toBeCalledWith({ \"to\": \"/restaurants\" });\n\n            expect(axiosMock.history.put.length).toBe(1); // times called\n            expect(axiosMock.history.put[0].params).toEqual({ id: 17 });\n            expect(axiosMock.history.put[0].data).toBe(JSON.stringify({\n                name: 'Freebirds World Burrito',\n                description: 'Totally Giant Burritos'\n            })); // posted object\n\n\n        });\n\n        test(\"Changes when you click Update\", async () => {\n\n            render(\n                <"+"QueryClientProvider client={queryClient}>\n                    <"+"MemoryRouter>\n                        <"+"RestaurantEditPage />\n                    <"+"/MemoryRouter>\n                <"+"/QueryClientProvider>\n            );\n\n            await screen.findByTestId(\"RestaurantForm-id\");\n\n            const idField = screen.getByTestId(\"RestaurantForm-id\");\n            const nameField = screen.getByTestId(\"RestaurantForm-name\");\n            const descriptionField = screen.getByTestId(\"RestaurantForm-description\");\n            const submitButton = screen.getByTestId(\"RestaurantForm-submit\");\n\n            expect(idField).toHaveValue(\"17\");\n            expect(nameField).toHaveValue(\"Freebirds\");\n            expect(descriptionField).toHaveValue(\"Burritos\");\n            expect(submitButton).toBeInTheDocument();\n\n            fireEvent.change(nameField, { target: { value: 'Freebirds World Burrito' } })\n            fireEvent.change(descriptionField, { target: { value: 'Big Burritos' } })\n\n            fireEvent.click(submitButton);\n\n            await waitFor(() => expect(mockToast).toBeCalled());\n            expect(mockToast).toBeCalledWith(\"Restaurant Updated - id: 17 name: Freebirds World Burrito\");\n            expect(mockNavigate).toBeCalledWith({ \"to\": \"/restaurants\" });\n        });\n\n       \n    });\n});\n"},"src/tests/components/Restaurants/RestaurantTable.test.js":{"tests":[{"id":"27","name":"RestaurantTable tests renders empty table correctly","location":{"start":{"column":4,"line":23}}},{"id":"28","name":"RestaurantTable tests Has the expected column headers, content and buttons for admin user","location":{"start":{"column":4,"line":49}}},{"id":"29","name":"RestaurantTable tests Has the expected column headers, content for ordinary user","location":{"start":{"column":4,"line":89}}},{"id":"30","name":"RestaurantTable tests Edit button navigates to the edit page","location":{"start":{"column":4,"line":124}}},{"id":"31","name":"RestaurantTable tests Delete button calls delete callback","location":{"start":{"column":4,"line":152}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { restaurantFixtures } from \"fixtures/restaurantFixtures\";\nimport RestaurantTable from \"main/components/Restaurants/RestaurantTable\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\n\nconst mockedNavigate = jest.fn();\n\njest.mock('react-router-dom', () => ({\n  ...jest.requireActual('react-router-dom'),\n  useNavigate: () => mockedNavigate\n}));\n\ndescribe(\"RestaurantTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  const expectedHeaders = [\"id\", \"Name\", \"Description\"];\n  const expectedFields = [\"id\", \"name\", \"description\"];\n  const testId = \"RestaurantTable\";\n\n  test(\"renders empty table correctly\", () => {\n    \n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={[]} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const fieldElement = screen.queryByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(fieldElement).not.toBeInTheDocument();\n    });\n  });\n\n  test(\"Has the expected column headers, content and buttons for admin user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={restaurantFixtures.threeRestaurants} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-name`)).toHaveTextContent(\"Cristino's Bakery\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"3\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-name`)).toHaveTextContent(\"Freebirds\");\n\n    const editButton = screen.getByTestId(`${testId}-cell-row-0-col-Edit-button`);\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`);\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n\n  });\n\n  test(\"Has the expected column headers, content for ordinary user\", () => {\n    // arrange\n    const currentUser = currentUserFixtures.userOnly;\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={restaurantFixtures.threeRestaurants} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    // assert\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-name`)).toHaveTextContent(\"Cristino's Bakery\");\n\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"3\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-name`)).toHaveTextContent(\"Freebirds\");\n\n    expect(screen.queryByText(\"Delete\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"Edit\")).not.toBeInTheDocument();\n  });\n\n\n  test(\"Edit button navigates to the edit page\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={restaurantFixtures.threeRestaurants} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    // assert - check that the expected content is rendered\n    expect(await screen.findByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-name`)).toHaveTextContent(\"Cristino's Bakery\");\n\n    const editButton = screen.getByTestId(`${testId}-cell-row-0-col-Edit-button`);\n    expect(editButton).toBeInTheDocument();\n\n    // act - click the edit button\n    fireEvent.click(editButton);\n\n    // assert - check that the navigate function was called with the expected path\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith('/restaurants/edit/2'));\n\n  });\n\n  test(\"Delete button calls delete callback\", async () => {\n    // arrange\n    const currentUser = currentUserFixtures.adminUser;\n\n    // act - render the component\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"RestaurantTable restaurants={restaurantFixtures.threeRestaurants} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n    );\n\n    // assert - check that the expected content is rendered\n    expect(await screen.findByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-name`)).toHaveTextContent(\"Cristino's Bakery\");\n\n    const deleteButton = screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`);\n    expect(deleteButton).toBeInTheDocument();\n\n    // act - click the delete button\n    fireEvent.click(deleteButton);\n  });\n});\n"},"src/tests/pages/Restaurants/RestaurantIndexPage.test.js":{"tests":[{"id":"32","name":"RestaurantIndexPage tests Renders with Create Button for admin user","location":{"start":{"column":6,"line":46}}},{"id":"33","name":"RestaurantIndexPage tests renders three restaurants correctly for regular user","location":{"start":{"column":6,"line":66}}},{"id":"34","name":"RestaurantIndexPage tests renders empty table when backend unavailable, user only","location":{"start":{"column":6,"line":96}}},{"id":"35","name":"RestaurantIndexPage tests what happens when you click delete, admin","location":{"start":{"column":6,"line":119}}}],"source":"import { render, screen, waitFor, fireEvent } from \"@testing-library/react\";\nimport RestaurantIndexPage from \"main/pages/Restaurants/RestaurantIndexPage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport mockConsole from \"jest-mock-console\";\nimport { restaurantFixtures } from \"fixtures/restaurantFixtures\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\ndescribe(\"RestaurantIndexPage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    const testId = \"RestaurantTable\";\n\n    const setupUserOnly = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    };\n\n    const setupAdminUser = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.adminUser);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    };\n\n\n    const queryClient = new QueryClient();\n\n    test(\"Renders with Create Button for admin user\", async () => {\n        setupAdminUser();\n        axiosMock.onGet(\"/api/restaurants/all\").reply(200, []);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => {\n            expect(screen.getByText(/Create Restaurant/)).toBeInTheDocument();\n        });\n        const button = screen.getByText(/Create Restaurant/);\n        expect(button).toHaveAttribute(\"href\", \"/restaurants/create\");\n        expect(button).toHaveAttribute(\"style\", \"float: right;\");\n    });\n\n    test(\"renders three restaurants correctly for regular user\", async () => {\n        setupUserOnly();\n        axiosMock.onGet(\"/api/restaurants/all\").reply(200, restaurantFixtures.threeRestaurants);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => { expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\"); });\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"3\");\n        expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\"4\");\n\n        const createRestaurantButton = screen.queryByText(\"Create Restaurant\");\n        expect(createRestaurantButton).not.toBeInTheDocument();\n\n        const name = screen.getByText(\"Freebirds\");\n        expect(name).toBeInTheDocument();\n\n        const description = screen.getByText(\"Burrito joint, and iconic Isla Vista location\");\n        expect(description).toBeInTheDocument();\n\n        // for non-admin users, details button is visible, but the edit and delete buttons should not be visible\n        expect(screen.queryByTestId(\"RestaurantTable-cell-row-0-col-Delete-button\")).not.toBeInTheDocument();\n        expect(screen.queryByTestId(\"RestaurantTable-cell-row-0-col-Edit-button\")).not.toBeInTheDocument();\n    });\n\n    test(\"renders empty table when backend unavailable, user only\", async () => {\n        setupUserOnly();\n\n        axiosMock.onGet(\"/api/restaurants/all\").timeout();\n\n        const restoreConsole = mockConsole();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => { expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1); });\n        \n        const errorMessage = console.error.mock.calls[0][0];\n        expect(errorMessage).toMatch(\"Error communicating with backend via GET on /api/restaurants/all\");\n        restoreConsole();\n\n    });\n\n    test(\"what happens when you click delete, admin\", async () => {\n        setupAdminUser();\n\n        axiosMock.onGet(\"/api/restaurants/all\").reply(200, restaurantFixtures.threeRestaurants);\n        axiosMock.onDelete(\"/api/restaurants\").reply(200, \"Restaurant with id 1 was deleted\");\n\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => { expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toBeInTheDocument(); });\n\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"2\");\n\n\n        const deleteButton = screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`);\n        expect(deleteButton).toBeInTheDocument();\n\n        fireEvent.click(deleteButton);\n\n        await waitFor(() => { expect(mockToast).toBeCalledWith(\"Restaurant with id 1 was deleted\") });\n\n        await waitFor(() => { expect(axiosMock.history.delete.length).toBe(1); });\n        expect(axiosMock.history.delete[0].url).toBe(\"/api/restaurants\");\n        expect(axiosMock.history.delete[0].url).toBe(\"/api/restaurants\");\n        expect(axiosMock.history.delete[0].params).toEqual({ id: 2 });\n    });\n\n});\n\n\n"},"src/tests/pages/UCSBDates/UCSBDatesIndexPage.test.js":{"tests":[{"id":"36","name":"UCSBDatesIndexPage tests Renders with Create Button for admin user","location":{"start":{"column":6,"line":45}}},{"id":"37","name":"UCSBDatesIndexPage tests renders three dates correctly for regular user","location":{"start":{"column":6,"line":69}}},{"id":"38","name":"UCSBDatesIndexPage tests renders empty table when backend unavailable, user only","location":{"start":{"column":6,"line":96}}},{"id":"39","name":"UCSBDatesIndexPage tests what happens when you click delete, admin","location":{"start":{"column":6,"line":122}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport UCSBDatesIndexPage from \"main/pages/UCSBDates/UCSBDatesIndexPage\";\n\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { ucsbDatesFixtures } from \"fixtures/ucsbDatesFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport mockConsole from \"jest-mock-console\";\n\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\ndescribe(\"UCSBDatesIndexPage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    const testId = \"UCSBDatesTable\";\n\n    const setupUserOnly = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    };\n\n    const setupAdminUser = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.adminUser);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    };\n\n    test(\"Renders with Create Button for admin user\", async () => {\n        // arrange\n        setupAdminUser();\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/ucsbdates/all\").reply(200, []);\n\n        // act\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        // assert\n        await waitFor( ()=>{\n            expect(screen.getByText(/Create UCSBDate/)).toBeInTheDocument();\n        });\n        const button = screen.getByText(/Create UCSBDate/);\n        expect(button).toHaveAttribute(\"href\", \"/ucsbdates/create\");\n        expect(button).toHaveAttribute(\"style\", \"float: right;\");\n    });\n\n    test(\"renders three dates correctly for regular user\", async () => {\n        \n        // arrange\n        setupUserOnly();\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/ucsbdates/all\").reply(200, ucsbDatesFixtures.threeDates);\n\n        // act\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        // assert\n        await waitFor(() => { expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\"); });\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"2\");\n        expect(screen.getByTestId(`${testId}-cell-row-2-col-id`)).toHaveTextContent(\"3\");\n\n        // assert that the Create button is not present when user isn't an admin\n        expect(screen.queryByText(/Create UCSBDate/)).not.toBeInTheDocument();\n\n    });\n\n\n    test(\"renders empty table when backend unavailable, user only\", async () => {\n        // arrange\n        setupUserOnly();\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/ucsbdates/all\").timeout();\n        const restoreConsole = mockConsole();\n\n        // act\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        // assert\n        await waitFor(() => { expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1); });\n\n        const errorMessage = console.error.mock.calls[0][0];\n        expect(errorMessage).toMatch(\"Error communicating with backend via GET on /api/ucsbdates/all\");\n        restoreConsole();\n\n        expect(screen.queryByTestId(`${testId}-cell-row-0-col-id`)).not.toBeInTheDocument();\n    });\n\n    test(\"what happens when you click delete, admin\", async () => {\n        // arrange\n        setupAdminUser();\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/ucsbdates/all\").reply(200, ucsbDatesFixtures.threeDates);\n        axiosMock.onDelete(\"/api/ucsbdates\").reply(200, \"UCSBDate with id 1 was deleted\");\n\n        // act\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesIndexPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        // assert\n        await waitFor(() => { expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toBeInTheDocument(); });\n\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\");\n\n        const deleteButton = screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`);\n        expect(deleteButton).toBeInTheDocument();\n\n        // act\n        fireEvent.click(deleteButton);\n\n        // assert\n        await waitFor(() => { expect(mockToast).toBeCalledWith(\"UCSBDate with id 1 was deleted\") });\n\n    });\n\n});\n\n\n"},"src/tests/components/UCSBDates/UCSBDatesTable.test.js":{"tests":[{"id":"40","name":"UserTable tests Has the expected column headers and content for ordinary user","location":{"start":{"column":4,"line":19}}},{"id":"41","name":"UserTable tests Has the expected colum headers and content for adminUser","location":{"start":{"column":4,"line":57}}},{"id":"42","name":"UserTable tests Edit button navigates to the edit page for admin user","location":{"start":{"column":4,"line":97}}}],"source":"import { fireEvent, render, waitFor, screen } from \"@testing-library/react\";\nimport { ucsbDatesFixtures } from \"fixtures/ucsbDatesFixtures\";\nimport UCSBDatesTable from \"main/components/UCSBDates/UCSBDatesTable\"\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\n\n\nconst mockedNavigate = jest.fn();\n\njest.mock('react-router-dom', () => ({\n    ...jest.requireActual('react-router-dom'),\n    useNavigate: () => mockedNavigate\n}));\n\ndescribe(\"UserTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"Has the expected column headers and content for ordinary user\", () => {\n\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBDatesTable dates={ucsbDatesFixtures.threeDates} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    const expectedHeaders = [\"id\", \"QuarterYYYYQ\", \"Name\", \"Date\"];\n    const expectedFields = [\"id\", \"quarterYYYYQ\", \"name\", \"localDateTime\"];\n    const testId = \"UCSBDatesTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"2\");\n\n    const editButton = screen.queryByTestId(`${testId}-cell-row-0-col-Edit-button`);\n    expect(editButton).not.toBeInTheDocument();\n\n    const deleteButton = screen.queryByTestId(`${testId}-cell-row-0-col-Delete-button`);\n    expect(deleteButton).not.toBeInTheDocument();\n\n  });\n\n  test(\"Has the expected colum headers and content for adminUser\", () => {\n\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBDatesTable dates={ucsbDatesFixtures.threeDates} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    const expectedHeaders = [\"id\", \"QuarterYYYYQ\", \"Name\", \"Date\"];\n    const expectedFields = [\"id\", \"quarterYYYYQ\", \"name\", \"localDateTime\"];\n    const testId = \"UCSBDatesTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\");\n    expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"2\");\n\n    const editButton = screen.getByTestId(`${testId}-cell-row-0-col-Edit-button`);\n    expect(editButton).toBeInTheDocument();\n    expect(editButton).toHaveClass(\"btn-primary\");\n\n    const deleteButton = screen.getByTestId(`${testId}-cell-row-0-col-Delete-button`);\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n\n  });\n\n  test(\"Edit button navigates to the edit page for admin user\", async () => {\n\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"UCSBDatesTable dates={ucsbDatesFixtures.threeDates} currentUser={currentUser} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>\n\n    );\n\n    await waitFor(() => { expect(screen.getByTestId(`UCSBDatesTable-cell-row-0-col-id`)).toHaveTextContent(\"1\"); });\n\n    const editButton = screen.getByTestId(`UCSBDatesTable-cell-row-0-col-Edit-button`);\n    expect(editButton).toBeInTheDocument();\n    \n    fireEvent.click(editButton);\n\n    await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith('/ucsbdates/edit/1'));\n\n  });\n\n});\n\n"},"src/tests/components/UCSBDates/UCSBDateForm.test.js":{"tests":[{"id":"43","name":"UCSBDateForm tests renders correctly","location":{"start":{"column":6,"line":16}}},{"id":"44","name":"UCSBDateForm tests renders correctly when passing in a UCSBDate","location":{"start":{"column":6,"line":28}}},{"id":"45","name":"UCSBDateForm tests Correct Error messsages on bad input","location":{"start":{"column":6,"line":41}}},{"id":"46","name":"UCSBDateForm tests Correct Error messsages on missing input","location":{"start":{"column":6,"line":60}}},{"id":"47","name":"UCSBDateForm tests No Error messsages on good input","location":{"start":{"column":6,"line":78}}},{"id":"48","name":"UCSBDateForm tests that navigate(-1) is called when Cancel is clicked","location":{"start":{"column":6,"line":108}}}],"source":"import { render, waitFor, fireEvent, screen } from \"@testing-library/react\";\nimport UCSBDateForm from \"main/components/UCSBDates/UCSBDateForm\";\nimport { ucsbDatesFixtures } from \"fixtures/ucsbDatesFixtures\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock('react-router-dom', () => ({\n    ...jest.requireActual('react-router-dom'),\n    useNavigate: () => mockedNavigate\n}));\n\n\ndescribe(\"UCSBDateForm tests\", () => {\n\n    test(\"renders correctly\", async () => {\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm />\n            <"+"/Router>\n        );\n        await screen.findByText(/Quarter YYYYQ/);\n        await screen.findByText(/Create/);\n    });\n\n\n    test(\"renders correctly when passing in a UCSBDate\", async () => {\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm initialContents={ucsbDatesFixtures.oneDate} />\n            <"+"/Router>\n        );\n        await screen.findByTestId(/UCSBDateForm-id/);\n        expect(screen.getByText(/Id/)).toBeInTheDocument();\n        expect(screen.getByTestId(/UCSBDateForm-id/)).toHaveValue(\"1\");\n    });\n\n\n    test(\"Correct Error messsages on bad input\", async () => {\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm />\n            <"+"/Router>\n        );\n        await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n        const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n        const localDateTimeField = screen.getByTestId(\"UCSBDateForm-localDateTime\");\n        const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n        fireEvent.change(quarterYYYYQField, { target: { value: 'bad-input' } });\n        fireEvent.change(localDateTimeField, { target: { value: 'bad-input' } });\n        fireEvent.click(submitButton);\n\n        await screen.findByText(/QuarterYYYYQ must be in the format YYYYQ/);\n    });\n\n    test(\"Correct Error messsages on missing input\", async () => {\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm />\n            <"+"/Router>\n        );\n        await screen.findByTestId(\"UCSBDateForm-submit\");\n        const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n        fireEvent.click(submitButton);\n\n        await screen.findByText(/QuarterYYYYQ is required./);\n        expect(screen.getByText(/Name is required./)).toBeInTheDocument();\n        expect(screen.getByText(/LocalDateTime is required./)).toBeInTheDocument();\n\n    });\n\n    test(\"No Error messsages on good input\", async () => {\n\n        const mockSubmitAction = jest.fn();\n\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm submitAction={mockSubmitAction} />\n            <"+"/Router>\n        );\n        await screen.findByTestId(\"UCSBDateForm-quarterYYYYQ\");\n\n        const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n        const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n        const localDateTimeField = screen.getByTestId(\"UCSBDateForm-localDateTime\");\n        const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n        fireEvent.change(quarterYYYYQField, { target: { value: '20221' } });\n        fireEvent.change(nameField, { target: { value: 'noon on January 2nd' } });\n        fireEvent.change(localDateTimeField, { target: { value: '2022-01-02T12:00' } });\n        fireEvent.click(submitButton);\n\n        await waitFor(() => expect(mockSubmitAction).toHaveBeenCalled());\n\n        expect(screen.queryByText(/QuarterYYYYQ must be in the format YYYYQ/)).not.toBeInTheDocument();\n        expect(screen.queryByText(/localDateTime must be in ISO format/)).not.toBeInTheDocument();\n\n    });\n\n\n    test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n\n        render(\n            <"+"Router  >\n                <"+"UCSBDateForm />\n            <"+"/Router>\n        );\n        await screen.findByTestId(\"UCSBDateForm-cancel\");\n        const cancelButton = screen.getByTestId(\"UCSBDateForm-cancel\");\n\n        fireEvent.click(cancelButton);\n\n        await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n\n    });\n\n});\n\n\n"},"src/tests/utils/systemInfo.test.js":{"tests":[{"id":"49","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves initial data","location":{"start":{"column":10,"line":15}}},{"id":"50","name":"utils/systemInfo tests useSystemInfo tests useSystemInfo retrieves data from API","location":{"start":{"column":10,"line":49}}},{"id":"51","name":"utils/systemInfo tests useSystemInfo tests systemInfo when API unreachable","location":{"start":{"column":10,"line":71}}}],"source":"import { QueryClient, QueryClientProvider } from \"react-query\";\nimport { useSystemInfo } from \"main/utils/systemInfo\";\nimport { renderHook } from '@testing-library/react-hooks'\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\njest.mock('react-router-dom');\nconst { _MemoryRouter } = jest.requireActual('react-router-dom');\n\ndescribe(\"utils/systemInfo tests\", () => {\n    describe(\"useSystemInfo tests\", () => {\n        test(\"useSystemInfo retrieves initial data\", async () => {\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").timeoutOnce();\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n            const restoreConsole = mockConsole();\n\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n            await waitFor(() => result.current.isSuccess);\n\n            expect(result.current.data).toEqual({ \n                initialData:true,   \n                springH2ConsoleEnabled: false,\n                showSwaggerUILink: false  \n            });\n            \n            const queryState = queryClient.getQueryState(\"systemInfo\");\n            expect(queryState).toBeDefined();\n\n            queryClient.clear();\n\n            await waitFor( ()=> expect(console.error).toHaveBeenCalled() );\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n        });\n\n        test(\"useSystemInfo retrieves data from API\", async () => {\n\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingBoth);\n\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n           \n\n            expect(result.current.data).toEqual(systemInfoFixtures.showingBoth);\n            queryClient.clear();\n\n        });\n\n        test(\"systemInfo when API unreachable\", async () => {\n\n            const queryClient = new QueryClient();\n            const wrapper = ({ children }) => (\n                <"+"QueryClientProvider client={queryClient}>\n                    {children}\n                <"+"/QueryClientProvider>\n            );\n\n            const axiosMock =new AxiosMockAdapter(axios);\n            axiosMock.onGet(\"/api/systemInfo\").reply(404)\n\n            const restoreConsole = mockConsole();\n            const { result, waitFor } = renderHook(() => useSystemInfo(), { wrapper });\n\n            await waitFor(() => result.current.isFetched);\n            expect(console.error).toHaveBeenCalled();\n            const errorMessage = console.error.mock.calls[0][0];\n            expect(errorMessage).toMatch(/Error invoking axios.get:/);\n            restoreConsole();\n\n            expect(result.current.data).toEqual({  \n                springH2ConsoleEnabled: false,\n                showSwaggerUILink: false \n            });\n            queryClient.clear();\n        });\n\n\n    });\n});\n"},"src/tests/pages/UCSBDates/UCSBDatesCreatePage.test.js":{"tests":[{"id":"52","name":"UCSBDatesCreatePage tests renders without crashing","location":{"start":{"column":6,"line":42}}},{"id":"53","name":"UCSBDatesCreatePage tests when you fill in the form and hit submit, it makes a request to the backend","location":{"start":{"column":6,"line":53}}}],"source":"import { render, waitFor, fireEvent, screen } from \"@testing-library/react\";\nimport UCSBDatesCreatePage from \"main/pages/UCSBDates/UCSBDatesCreatePage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\nconst mockNavigate = jest.fn();\njest.mock('react-router-dom', () => {\n    const originalModule = jest.requireActual('react-router-dom');\n    return {\n        __esModule: true,\n        ...originalModule,\n        Navigate: (x) => { mockNavigate(x); return null; }\n    };\n});\n\ndescribe(\"UCSBDatesCreatePage tests\", () => {\n\n    const axiosMock =new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    test(\"renders without crashing\", () => {\n        const queryClient = new QueryClient();\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesCreatePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n    });\n\n    test(\"when you fill in the form and hit submit, it makes a request to the backend\", async () => {\n\n        const queryClient = new QueryClient();\n        const ucsbDate = {\n            id: 17,\n            quarterYYYYQField: 20221,\n            name: \"Groundhog Day\",\n            localDateTime: \"2022-02-02T00:00\"\n        };\n\n        axiosMock.onPost(\"/api/ucsbdates/post\").reply( 202, ucsbDate );\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"UCSBDatesCreatePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => {\n            expect(screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\")).toBeInTheDocument();\n        });\n\n        const quarterYYYYQField = screen.getByTestId(\"UCSBDateForm-quarterYYYYQ\");\n        const nameField = screen.getByTestId(\"UCSBDateForm-name\");\n        const localDateTimeField = screen.getByTestId(\"UCSBDateForm-localDateTime\");\n        const submitButton = screen.getByTestId(\"UCSBDateForm-submit\");\n\n        fireEvent.change(quarterYYYYQField, { target: { value: '20221' } });\n        fireEvent.change(nameField, { target: { value: 'Groundhog Day' } });\n        fireEvent.change(localDateTimeField, { target: { value: '2022-02-02T00:00' } });\n\n        expect(submitButton).toBeInTheDocument();\n\n        fireEvent.click(submitButton);\n\n        await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n        expect(axiosMock.history.post[0].params).toEqual(\n            {\n            \"localDateTime\": \"2022-02-02T00:00\",\n            \"name\": \"Groundhog Day\",\n            \"quarterYYYYQ\": \"20221\"\n        });\n\n        expect(mockToast).toBeCalledWith(\"New ucsbDate Created - id: 17 name: Groundhog Day\");\n        expect(mockNavigate).toBeCalledWith({ \"to\": \"/ucsbdates\" });\n    });\n\n\n});\n\n\n"},"src/tests/pages/Restaurants/RestaurantCreatePage.test.js":{"tests":[{"id":"54","name":"RestaurantCreatePage tests renders without crashing","location":{"start":{"column":6,"line":45}}},{"id":"55","name":"RestaurantCreatePage tests on submit, makes request to backend, and redirects to /restaurants","location":{"start":{"column":6,"line":55}}}],"source":"import { render, screen, fireEvent, waitFor } from \"@testing-library/react\";\nimport RestaurantCreatePage from \"main/pages/Restaurants/RestaurantCreatePage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nconst mockToast = jest.fn();\njest.mock('react-toastify', () => {\n    const originalModule = jest.requireActual('react-toastify');\n    return {\n        __esModule: true,\n        ...originalModule,\n        toast: (x) => mockToast(x)\n    };\n});\n\nconst mockNavigate = jest.fn();\njest.mock('react-router-dom', () => {\n    const originalModule = jest.requireActual('react-router-dom');\n    return {\n        __esModule: true,\n        ...originalModule,\n        Navigate: (x) => { mockNavigate(x); return null; }\n    };\n});\n\ndescribe(\"RestaurantCreatePage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    beforeEach(() => {\n        jest.clearAllMocks();\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    const queryClient = new QueryClient();\n    test(\"renders without crashing\", () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantCreatePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n    });\n\n    test(\"on submit, makes request to backend, and redirects to /restaurants\", async () => {\n\n        const queryClient = new QueryClient();\n        const restaurant = {\n            id: 3,\n            name: \"South Coast Deli\",\n            description: \"Sandwiches and Salads\"\n        };\n\n        axiosMock.onPost(\"/api/restaurants/post\").reply(202, restaurant);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"RestaurantCreatePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        )\n\n        await waitFor(() => {\n            expect(screen.getByLabelText(\"Name\")).toBeInTheDocument();\n        });\n\n        const nameInput = screen.getByLabelText(\"Name\");\n        expect(nameInput).toBeInTheDocument();\n\n        const descriptionInput = screen.getByLabelText(\"Description\");\n        expect(descriptionInput).toBeInTheDocument();\n\n        const createButton = screen.getByText(\"Create\");\n        expect(createButton).toBeInTheDocument();\n\n        fireEvent.change(nameInput, { target: { value: 'South Coast Deli' } })\n        fireEvent.change(descriptionInput, { target: { value: 'Sandwiches and Salads' } })\n        fireEvent.click(createButton);\n\n        await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n        expect(axiosMock.history.post[0].params).toEqual({\n            name: \"South Coast Deli\",\n            description: \"Sandwiches and Salads\"\n        });\n\n        // assert - check that the toast was called with the expected message\n        expect(mockToast).toBeCalledWith(\"New restaurant Created - id: 3 name: South Coast Deli\");\n        expect(mockNavigate).toBeCalledWith({ \"to\": \"/restaurants\" });\n\n    });\n});\n\n\n"},"src/tests/components/Restaurants/RestaurantForm.test.js":{"tests":[{"id":"56","name":"RestaurantForm tests renders correctly with no initialContents","location":{"start":{"column":6,"line":22}}},{"id":"57","name":"RestaurantForm tests renders correctly when passing in initialContents","location":{"start":{"column":6,"line":40}}},{"id":"58","name":"RestaurantForm tests that navigate(-1) is called when Cancel is clicked","location":{"start":{"column":6,"line":61}}},{"id":"59","name":"RestaurantForm tests that the correct validations are performed","location":{"start":{"column":6,"line":77}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nimport RestaurantForm from \"main/components/Restaurants/RestaurantForm\";\nimport { restaurantFixtures } from \"fixtures/restaurantFixtures\";\n\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock('react-router-dom', () => ({\n    ...jest.requireActual('react-router-dom'),\n    useNavigate: () => mockedNavigate\n}));\n\ndescribe(\"RestaurantForm tests\", () => {\n    const queryClient = new QueryClient();\n\n    const expectedHeaders = [\"Name\", \"Description\"];\n    const testId = \"RestaurantForm\";\n\n    test(\"renders correctly with no initialContents\", async () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"Router>\n                    <"+"RestaurantForm />\n                <"+"/Router>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n        expectedHeaders.forEach((headerText) => {\n            const header = screen.getByText(headerText);\n            expect(header).toBeInTheDocument();\n        });\n\n    });\n\n    test(\"renders correctly when passing in initialContents\", async () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"Router>\n                    <"+"RestaurantForm initialContents={restaurantFixtures.oneRestaurant} />\n                <"+"/Router>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(/Create/)).toBeInTheDocument();\n\n        expectedHeaders.forEach((headerText) => {\n            const header = screen.getByText(headerText);\n            expect(header).toBeInTheDocument();\n        });\n\n        expect(await screen.findByTestId(`${testId}-id`)).toBeInTheDocument();\n        expect(screen.getByText(`Id`)).toBeInTheDocument();\n    });\n\n\n    test(\"that navigate(-1) is called when Cancel is clicked\", async () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"Router>\n                    <"+"RestaurantForm />\n                <"+"/Router>\n            <"+"/QueryClientProvider>\n        );\n        expect(await screen.findByTestId(`${testId}-cancel`)).toBeInTheDocument();\n        const cancelButton = screen.getByTestId(`${testId}-cancel`);\n\n        fireEvent.click(cancelButton);\n\n        await waitFor(() => expect(mockedNavigate).toHaveBeenCalledWith(-1));\n    });\n\n    test(\"that the correct validations are performed\", async () => {\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"Router>\n                    <"+"RestaurantForm />\n                <"+"/Router>\n            <"+"/QueryClientProvider>\n        );\n\n        expect(await screen.findByText(/Create/)).toBeInTheDocument();\n        const submitButton = screen.getByText(/Create/);\n        fireEvent.click(submitButton);\n\n        await screen.findByText(/Name is required/);\n        expect(screen.getByText(/Description is required/)).toBeInTheDocument();\n\n        const nameInput = screen.getByTestId(`${testId}-name`);\n        fireEvent.change(nameInput, { target: { value: \"a\".repeat(31) } });\n        fireEvent.click(submitButton);\n\n        await waitFor(() => {\n            expect(screen.getByText(/Max length 30 characters/)).toBeInTheDocument();\n        });\n    });\n\n});"},"src/tests/components/OurTable.test.js":{"tests":[{"id":"60","name":"OurTable tests renders an empty table without crashing","location":{"start":{"column":6,"line":34}}},{"id":"61","name":"OurTable tests renders a table with three rows without crashing","location":{"start":{"column":6,"line":40}}},{"id":"62","name":"OurTable tests The button appears in the table","location":{"start":{"column":6,"line":46}}},{"id":"63","name":"OurTable tests default testid is testId","location":{"start":{"column":6,"line":57}}},{"id":"64","name":"OurTable tests click on a header and a sort caret should appear","location":{"start":{"column":6,"line":64}}}],"source":"import { render, waitFor, fireEvent, screen } from \"@testing-library/react\";\nimport OurTable, {ButtonColumn} from \"main/components/OurTable\";\n\ndescribe(\"OurTable tests\", () => {\n    const threeRows = [\n        {\n            col1: 'Hello',\n            col2: 'World',\n        },\n        {\n            col1: 'react-table',\n            col2: 'rocks',\n        },\n        {\n            col1: 'whatever',\n            col2: 'you want',\n        }\n    ];\n\n    const clickMeCallback = jest.fn();\n\n    const columns = [\n        {\n            Header: 'Column 1',\n            accessor: 'col1', // accessor is the \"key\" in the data\n        },\n        {\n            Header: 'Column 2',\n            accessor: 'col2',\n        },\n        ButtonColumn(\"Click\", \"primary\", clickMeCallback, \"testId\"),\n    ];\n\n    test(\"renders an empty table without crashing\", () => {\n        render(\n            <"+"OurTable columns={columns} data={[]} />\n        );\n    });\n\n    test(\"renders a table with three rows without crashing\", () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n    });\n\n    test(\"The button appears in the table\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n\n        await screen.findByTestId(\"testId-cell-row-0-col-Click-button\");\n        const button = screen.getByTestId(\"testId-cell-row-0-col-Click-button\");\n        fireEvent.click(button);\n        await waitFor(()=>expect(clickMeCallback).toBeCalledTimes(1));\n    });\n\n    test(\"default testid is testId\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} />\n        );\n        await screen.findByTestId(\"testid-header-col1\");\n    });\n\n    test(\"click on a header and a sort caret should appear\", async () => {\n        render(\n            <"+"OurTable columns={columns} data={threeRows} testid={\"sampleTestId\"} />\n        );\n\n        await screen.findByTestId(\"sampleTestId-header-col1\");\n        const col1Header = screen.getByTestId(\"sampleTestId-header-col1\");\n\n        const col1SortCarets = screen.getByTestId(\"sampleTestId-header-col1-sort-carets\");\n        expect(col1SortCarets).toHaveTextContent('');\n\n        const col1Row0 = screen.getByTestId(\"sampleTestId-cell-row-0-col-col1\");\n        expect(col1Row0).toHaveTextContent(\"Hello\");\n\n        fireEvent.click(col1Header);\n        await screen.findByText(\"🔼\");\n\n        fireEvent.click(col1Header);\n        await screen.findByText(\"🔽\");\n    });\n\n});"},"src/tests/pages/AdminUsersPage.test.js":{"tests":[{"id":"65","name":"AdminUsersPage tests renders without crashing on three users","location":{"start":{"column":6,"line":26}}},{"id":"66","name":"AdminUsersPage tests renders empty table when backend unavailable","location":{"start":{"column":6,"line":40}}}],"source":"import { render, waitFor, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport AdminUsersPage from \"main/pages/AdminUsersPage\";\nimport usersFixtures from \"fixtures/usersFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport mockConsole from \"jest-mock-console\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"AdminUsersPage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    const testId = \"UsersTable\";\n\n    beforeEach( () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    });\n\n    test(\"renders without crashing on three users\", async () => {\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/admin/users\").reply(200, usersFixtures.threeUsers);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AdminUsersPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n        await screen.findByText(\"Users\");\n    });\n\n    test(\"renders empty table when backend unavailable\", async () => {\n        const queryClient = new QueryClient();\n        axiosMock.onGet(\"/api/admin/users\").timeout();\n\n        const restoreConsole = mockConsole();\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"AdminUsersPage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await waitFor(() => { expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1); });\n\n        const errorMessage = console.error.mock.calls[0][0];\n        expect(errorMessage).toMatch(\"Error communicating with backend via GET on /api/admin/users\");\n        restoreConsole();\n\n        expect(screen.queryByTestId(`${testId}-cell-row-0-col-id`)).not.toBeInTheDocument();\n\n    });\n\n\n});\n\n\n"},"src/tests/pages/ProfilePage.test.js":{"tests":[{"id":"67","name":"ProfilePage tests renders correctly for regular logged in user","location":{"start":{"column":6,"line":15}}},{"id":"68","name":"ProfilePage tests renders correctly for admin user","location":{"start":{"column":6,"line":33}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { apiCurrentUserFixtures }  from \"fixtures/currentUserFixtures\";\n\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport ProfilePage from \"main/pages/ProfilePage\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\ndescribe(\"ProfilePage tests\", () => {\n\n    const queryClient = new QueryClient();\n\n    test(\"renders correctly for regular logged in user\", async () => {\n\n        const axiosMock =new AxiosMockAdapter(axios);\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"ProfilePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Phillip Conrad\");\n        expect(screen.getByText(\"pconrad.cis@gmail.com\")).toBeInTheDocument();\n    });\n\n    test(\"renders correctly for admin user\", async () => {\n\n        const axiosMock =new AxiosMockAdapter(axios);\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.adminUser);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n                    <"+"ProfilePage />\n                <"+"/MemoryRouter>\n            <"+"/QueryClientProvider>\n        );\n\n        await screen.findByText(\"Phill Conrad\");\n        expect(screen.getByText(\"phtcon@ucsb.edu\")).toBeInTheDocument();\n        expect(screen.getByTestId(\"role-badge-user\")).toBeInTheDocument();\n        expect(screen.getByTestId(\"role-badge-admin\")).toBeInTheDocument();\n        expect(screen.getByTestId(\"role-badge-member\")).toBeInTheDocument();\n    });\n});\n\n\n"},"src/tests/utils/arrayUtils.test.js":{"tests":[{"id":"69","name":"arrayUtils tests getFirstSmallestLargest abbr","location":{"start":{"column":4,"line":39}}},{"id":"70","name":"arrayUtils tests getFirstSmallestLargest name","location":{"start":{"column":4,"line":49}}},{"id":"71","name":"arrayUtils tests getFirstSmallestLargest symbols.bird","location":{"start":{"column":4,"line":59}}},{"id":"72","name":"arrayUtils tests getFirstSmallestLargest symbols.flower","location":{"start":{"column":4,"line":69}}}],"source":"import { getFirstSmallestLargest } from \"main/utils/arrayUtils\";\n\ndescribe(\"arrayUtils tests\", () => {\n  const states = [\n    {\n      abbr: \"CA\",\n      name: \"California\",\n      symbols: {\n        bird: \"California Quail\",\n        flower: \"California Poppy\",\n      },\n    },\n    {\n      abbr: \"OR\",\n      name: \"Oregon\",\n      symbols: {\n        bird: \"Western Meadowlark\",\n        flower: \"Oregon Grape\",\n      },\n    },\n    {\n      abbr: \"NV\",\n      name: \"Nevada\",\n      symbols: {\n        bird: \"Mountain Bluebird\",\n        flower: \"Big Sagebrush\",\n      },\n    },\n    {\n      abbr: \"AK\",\n      name: \"Alaska\",\n      symbols: {\n        bird: \"Willow ptarmigan\",\n        flower: \"Forget-me-not\",\n      },\n    },\n  ];\n\n  test(\"getFirstSmallestLargest abbr\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.abbr\n    );\n    expect(first).toBe(\"CA\");\n    expect(smallest).toBe(\"AK\");\n    expect(largest).toBe(\"OR\");\n  });\n\n  test(\"getFirstSmallestLargest name\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.name\n    );\n    expect(first).toBe(\"California\");\n    expect(smallest).toBe(\"Alaska\");\n    expect(largest).toBe(\"Oregon\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.bird\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.bird\n    );\n    expect(first).toBe(\"California Quail\");\n    expect(smallest).toBe(\"California Quail\");\n    expect(largest).toBe(\"Willow ptarmigan\");\n  });\n\n  test(\"getFirstSmallestLargest symbols.flower\", () => {\n    const { first, smallest, largest } = getFirstSmallestLargest(\n      states,\n      (s) => s.symbols.flower\n    );\n    expect(first).toBe(\"California Poppy\");\n    expect(smallest).toBe(\"Big Sagebrush\");\n    expect(largest).toBe(\"Oregon Grape\");\n  });\n});\n"},"src/tests/components/Users/UsersTable.test.js":{"tests":[{"id":"73","name":"UserTable tests renders without crashing for empty table","location":{"start":{"column":6,"line":8}}},{"id":"74","name":"UserTable tests renders without crashing for three users","location":{"start":{"column":6,"line":14}}},{"id":"75","name":"UserTable tests Has the expected colum headers and content","location":{"start":{"column":6,"line":20}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport usersFixtures from \"fixtures/usersFixtures\";\nimport UsersTable from \"main/components/Users/UsersTable\"\n\n\ndescribe(\"UserTable tests\", () => {\n\n    test(\"renders without crashing for empty table\", () => {\n        render(\n            <"+"UsersTable users={[]} />\n        );\n    });\n\n    test(\"renders without crashing for three users\", () => {\n        render(\n            <"+"UsersTable users={usersFixtures.threeUsers} />\n        );\n    });\n\n    test(\"Has the expected colum headers and content\", () => {\n        render(\n          <"+"UsersTable users={usersFixtures.threeUsers}/>\n        );\n    \n        const expectedHeaders = [\"id\", \"First Name\", \"Last Name\", \"Email\", \"Admin\"];\n        const expectedFields = [\"id\", \"givenName\", \"familyName\", \"email\", \"admin\"];\n        const testId = \"UsersTable\";\n\n        expectedHeaders.forEach( (headerText)=> {\n            const header = screen.getByText(headerText);\n            expect(header).toBeInTheDocument();\n        });\n\n        expectedFields.forEach( (field)=> {\n          const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n          expect(header).toBeInTheDocument();\n        });\n\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\"1\");\n        expect(screen.getByTestId(`${testId}-cell-row-0-col-admin`)).toHaveTextContent(\"true\");\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-id`)).toHaveTextContent(\"2\");\n        expect(screen.getByTestId(`${testId}-cell-row-1-col-admin`)).toHaveTextContent(\"false\");\n\n      });\n});\n\n"},"src/tests/pages/Placeholder/PlaceholderIndexPage.test.js":{"tests":[{"id":"76","name":"PlaceholderIndexPage tests Renders expected content","location":{"start":{"column":6,"line":24}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport PlaceholderIndexPage from \"main/pages/Placeholder/PlaceholderIndexPage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\n\ndescribe(\"PlaceholderIndexPage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    const setupUserOnly = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n          expect(message).toMatch(\"abc\");\n\n            restoreConsole();\n        });\n\n    });\n    describe(\"cellToAxiosParamsDelete\", () => {\n\n        test(\"It returns the correct params\", () => {\n            // arrange\n            const cell = { row: { values: { id: 17 } } };\n\n            // act\n            const result = cellToAxiosParamsDelete(cell);\n\n            // assert\n            expect(result).toEqual({\n                url: \"/api/ucsbdates\",\n                method: \"DELETE\",\n                params: { id: 17 }\n            });\n        });\n\n    });\n});\n\n\n\n\n\n"},"src/tests/pages/Placeholder/PlaceholderCreatePage.test.js":{"tests":[{"id":"79","name":"PlaceholderCreatePage tests Renders expected content","location":{"start":{"column":6,"line":23}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport PlaceholderCreatePage from \"main/pages/Placeholder/PlaceholderCreatePage\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\ndescribe(\"PlaceholderCreatePage tests\", () => {\n\n    const axiosMock = new AxiosMockAdapter(axios);\n\n    const setupUserOnly = () => {\n        axiosMock.reset();\n        axiosMock.resetHistory();\n        axiosMock.onGet(\"/api/currentUser\").reply(200, apiCurrentUserFixtures.userOnly);\n        axiosMock.onGet(\"/api/systemInfo\").reply(200, systemInfoFixtures.showingNeither);\n    };\n\n    const queryClient = new QueryClient();\n    test(\"Renders expected content\", () => {\n        // arrange\n\n        setupUserOnly();\n       \n        // act\n        render(\n            <"+"QueryClientProvider client={queryClient}>\n                <"+"MemoryRouter>\n
